import axios from "axios";

export function users(data){
    return (dispatch) => {
        axios.get(`http://api.openweathermap.org/data/2.5/weather?q=$London&lang=ru&units=metric&appid=$17582dea4abae09f22389693d0af9aa6`)
    }
}
